import { Component } from "react";
import './card-list.styles.css'


class CardList extends Component {
  render() {
    console.log("render !!!");
    const { linuxHosts } = this.props;

    return (
      <div className="card-list">
        {linuxHosts.map((eachHost) => {
          const { name,email,id } = eachHost
          return (
            <div className="card-container" key={id}>
              <img
                alt={`host ${name}`}
                src={`https://cdn-icons-png.flaticon.com/512/915/915974.png?w=360`}
                width={70}
              />
              <h2>{name}</h2>
              <p>{email}</p>
            </div>
          );
        })}
      </div>
    );
  }
}

export default CardList;
